import React from 'react';
import { NavLink } from 'react-router-dom';
import { FaBars } from 'react-icons/fa';

const Navigation = () => {

  return (
    <div className="sidebar">
      <ul>
        <li>
          <NavLink exact to="/" activeClassName="navActive">

            <span>Home</span>
          </NavLink>
        </li>
      </ul>

    </div>
  );
};

export default Navigation;
